import React from "react";
import Grid from "@material-ui/core/Grid";
import { ShowOtherwiseProperty } from "./BooleanProperties";
import {
  OtherwiseLabelProperty,
  OtherwiseTooltipProperty,
} from "./TextProperties";
import {
  MinProperty,
  MaxProperty,
  StepProperty,
  HoursFromProperty,
  HoursToProperty,
  HoursStepProperty,
  MaxLengthProperty,
} from "./NumericProperties";
import { makeStyles } from "@material-ui/core";

// not in use yet
export const DataMethodProperty = ({ ...props }) => {
  return null;
};
export const ExpandableContentProperty = ({ ...props }) => null;

// Composite properties. These consists of smaller properties, depending on each other:
export const OtherwiseProperty = ({ newQuestion, newQuestionDispatch }) => {
  return (
    <>
      <ShowOtherwiseProperty
        newQuestion={newQuestion}
        newQuestionDispatch={newQuestionDispatch}
      />
      {newQuestion.show_otherwise ? (
        <Grid item xs style={{ textAlign: "center", margin: "1em 0" }}>
          <OtherwiseLabelProperty
            newQuestion={newQuestion}
            newQuestionDispatch={newQuestionDispatch}
          />
          <OtherwiseTooltipProperty
            newQuestion={newQuestion}
            newQuestionDispatch={newQuestionDispatch}
          />
        </Grid>
      ) : null}
    </>
  );
};

export const DefaultDateCompositionProperty = ({
  newQuestion,
  newQuestionDispatch,
}) => {};

export const CustomMinMaxStepProperty = () => {
  return (
    <Grid
      container
      direction="row"
      justify="space-between"
      alignItems="center"
      spacing={2}
    >
      <Grid item xs={4}>
        <MaxProperty />
      </Grid>
      <Grid item xs={4}>
        <MinProperty />
      </Grid>
      <Grid item xs={4}>
        <StepProperty />
      </Grid>
    </Grid>
  );
};

export const HoursCompositeProperty = () => {
  return (
    <Grid
      container
      direction="row"
      justify="space-between"
      alignItems="center"
      spacing={2}
    >
      <Grid item xs={4}>
        <HoursFromProperty />
      </Grid>
      <Grid item xs={4}>
        <HoursToProperty />
      </Grid>
      <Grid item xs={4}>
        <HoursStepProperty />
      </Grid>
    </Grid>
  );
};

export const NumberTypeComposite = () => {
  return (
    <Grid
      container
      direction="row"
      justify="space-between"
      alignItems="center"
      spacing={2}
    >
      <Grid item xs={4}>
        <MinProperty />
      </Grid>
      <Grid item xs={4}>
        <MaxProperty />
      </Grid>
      <Grid item xs={4}>
        <MaxLengthProperty />
      </Grid>
    </Grid>
  );
};

export const WidthHeightComposite = () => {
  return (
    <Grid
      container
      direction="row"
      justify="space-between"
      alignItems="center"
      spacing={2}
    >
      <Grid item xs={4}>
        <MinProperty />
      </Grid>
      <Grid item xs={4}>
        <MaxProperty />
      </Grid>
      <Grid item xs={4}>
        <MaxLengthProperty />
      </Grid>
    </Grid>
  );
};
